This method will generate a manifest of all orders registered via API based on the date intervals provided in the request.

Request URL: https://sandbox.eswdb2b.com/api/courier_v1/manifests/generate

Data:

destinations_id - destination country ID of the manifest;

origins_id  origin country ID of the manifest;

date_from(date)  orders registered from this date will be included in the manifest;

date_to(date)  orders registered to this date will be included in the manifest;

sender_address(varchar(255))  senders address from where the orders will be picked-up.

